pragma solidity ^0.4.8;

contract Coupon {


    mapping(address => bool) retailerExists;
    address public owner;

    // Bidding duration in minutes
    constructor() public {

        owner=msg.sender;


    }

    modifier onlyOwner()
    {
        require(owner==msg.sender);
        _;
    }

    modifier onlyRetailer()
    {
        require(ifExist(msg.sender));
        _;
    }


    function ifExist(address x) public view returns (bool) {
        return retailerExists[x];
    }




    function addRetailer(address addr) onlyOwner public returns (string memory)
    {
       if(!(ifExist(addr)))
       {
            retailerExists[addr]=true;
        return("Success..!!!");
        }
    }


    function retailerOrOwner() public view returns (address)
    {
        return msg.sender;
    }

}
